  return (
    <div>
      <Navbar />
      <Opener />
      <div class = "remainingSection">
        <AboutMe/>
        <Education/>
        <Certifications/>
        <WorkExperience/>
        <ContactMe />
        <BarChart/>
        <WorldMap />
      </div>
      
    </div>
  );
}

export default App;
